import logo from './logo.svg';
import './App.css';
import './index.css';
import ReactSearchBox from 'react-search-box'


const SerachBox = (props) =>{
  return <ReactSearchBox
  placeholder="Search a course"
  value="Doe"
  data={props.list}
  callback={(record) => console.log(record)}
  />
}



function App() {
  const data = [
    {
      key: "john",
      value: "John Doe",
    },
    {
      key: "jane",
      value: "Jane Doe",
    },
    {
      key: "mary",
      value: "Mary Phillips",
    },
    {
      key: "robert",
      value: "Robert",
    },
    {
      key: "karius",
      value: "Karius",
    },
  ]

  return (
    <div className="App">
      <button className = "loginButton">Login</button>

      <p className="helloWorld">
        Hello World
        <ReactSearchBox
        placeholder="Placeholder"
        value="Doe"
        data={this.data}
        callback={(record) => console.log(record)}
      />
      </p>


    </div>


  );
}

export default App;
